import React from 'react';
import ReactDOM from 'react-dom/client';

import './shared/styles/index.css'; // Assuming you have a global CSS file here
import App from './App';
import reportWebVitals from './reportWebVitals'; // Optional: for performance monitoring
import './core/config/environment'; // Create this file to handle env loading

console.log("Environment test:", {
  NODE_ENV: process.env.NODE_ENV,
  TEST_VAR: process.env.REACT_APP_TEST_VAR,
  API_KEY_EXISTS: process.env.REACT_APP_FIREBASE_API_KEY ? "YES" : "NO"
});

const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);

// If you want to start measuring performance in your app, pass a function
// to log results (for example: reportWebVitals(console.log))
// or send to an analytics endpoint. Learn more: https://bit.ly/CRA-vitals
reportWebVitals();
